package com.springmvc.model;

public class RowLable {

	private String lableID;
	private String row_1;
	private String row_2;
	private String row_3;
	private String row_4;
	private String row_5;
	
	public RowLable() {
		super();
		// TODO Auto-generated constructor stub
	}

	public RowLable(String lableID, String row_1, String row_2, String row_3, String row_4, String row_5) {
		super();
		this.lableID = lableID;
		this.row_1 = row_1;
		this.row_2 = row_2;
		this.row_3 = row_3;
		this.row_4 = row_4;
		this.row_5 = row_5;
	}

	public String getLableID() {
		return lableID;
	}

	public void setLableID(String lableID) {
		this.lableID = lableID;
	}

	public String getRow_1() {
		return row_1;
	}

	public void setRow_1(String row_1) {
		this.row_1 = row_1;
	}

	public String getRow_2() {
		return row_2;
	}

	public void setRow_2(String row_2) {
		this.row_2 = row_2;
	}

	public String getRow_3() {
		return row_3;
	}

	public void setRow_3(String row_3) {
		this.row_3 = row_3;
	}

	public String getRow_4() {
		return row_4;
	}

	public void setRow_4(String row_4) {
		this.row_4 = row_4;
	}

	public String getRow_5() {
		return row_5;
	}

	public void setRow_5(String row_5) {
		this.row_5 = row_5;
	}
	
	

}
